import React, { useEffect, useState } from "react";
import axios from "axios";
import "./IndexPage.css";
import { Link } from "react-router-dom";
import Image from "./image";

function Fructe() {
  const [places, setPlaces] = useState([]);
  const [currentPage, setCurrentPage] = useState(1);
  const placesPerPage = 9;
  const [cartItems, setCartItems] = useState([]);

  useEffect(() => {
    axios.get("/places").then((response) => {
      const filteredPlaces = response.data.filter(
        (place) => place.marca === "Fructe"
      );
      setPlaces(filteredPlaces);
    });
  }, []);

  const lastPlaceIndex = currentPage * placesPerPage;
  const firstPlaceIndex = lastPlaceIndex - placesPerPage;
  const currentPlaces = places.slice(firstPlaceIndex, lastPlaceIndex);
  const totalPages = Math.ceil(places.length / placesPerPage);

  const handlePageChange = (pageNumber) => {
    setCurrentPage(pageNumber);
    if (window.pageYOffset > 0) {
      window.scrollTo(0, 0);
    }
  };

  const addToCart = (place) => {
    const updatedCartItems = [...cartItems];
    updatedCartItems.push(place);
    setCartItems(updatedCartItems);
  };

  const removeFromCart = (placeId) => {
    const updatedCartItems = cartItems.filter((place) => place._id !== placeId);
    setCartItems(updatedCartItems);
  };

  const handleCheckout = () => {
    // Implement your checkout logic here, e.g., sending a request to the backend
    console.log("Checkout:", cartItems);
    // Clear the cart after checkout
    setCartItems([]);
  };

  return (
    <>
      <div className="top"></div>
      <div className="main2">
        <div className="container">
          <div className="details container">
            <div className="row row-cols-sm-1 row-cols-md-2 row-cols-lg-3 g-4">
              {currentPlaces.length > 0 &&
                currentPlaces
                  .filter((place) => place.marca === "Fructe")
                  .map((place) => (
                    <Link
                      to={"/place/" + place._id}
                      key={place._id}
                      className="link-no-underline"
                    >
                      <div className="col">
                        <div className="box card-body p-0  shadow-sm mb-5">
                          {place.photos.length > 0 && (
                            <Image
                              src={place.photos[0]}
                              className="img-fluid"
                              style={{
                                height: "270px",
                                width: "100%",
                                objectFit: "cover",
                              }}
                            />
                          )}
                          <div className="box_content">
                            <h4>{place.title}</h4>
                            <div className="row pl-2 pr-2">
                              <div>{place.putere}</div>
                              <button
                                style={{
                                  background: "#cccccc00",
                                  color: "var(--main)",
                                }}
                                className="btn1"
                                onClick={() => addToCart(place)}
                              >
                                Add to Cart
                              </button>
                            </div>
                          </div>
                        </div>
                      </div>
                    </Link>
                  ))}
            </div>
          </div>
        </div>
      </div>

      <div className="basket-container">
        <h2>Cart</h2>
        {cartItems.length === 0 ? (
    <p>Your cart is empty.</p>
  ) : (
    <ul>
      {cartItems.map((item) => (
        <li key={item._id}>
          {item.title} - {item.putere}
          <button onClick={() => removeFromCart(item._id)}>Remove</button>
        </li>
      ))}
    </ul>
  )}

  {cartItems.length > 0 && (
    <button className="checkout-btn" onClick={handleCheckout}>
      Checkout
    </button>
  )}
</div>
 </>
  );
}

export default Fructe;
